              {
                "source": "internal",
                "locale": "en-US",
                "value": "There are few quadcopters out there that can combine presentation and performance. Airhawk's sophisticated aircraft is self-regulating to help users fight against flight disturbances, such as wind or flight drift. Features such as automatic return and Headless mode make it simple to keep your orientation, no matter how far you fly, making flying this device simple and intuitive. The ease of use makes this the perfect copter for both beginners and experienced flyers alike.  The sky???s the limit when it comes to flying this quadcopter. Equipped with a 6-axis gyro to ensure maximum stability during flight, this copter can be flown in all directions easily. Fly up, down, backwards and forwards, right to left or hover in place. The extreme stability and agility of the device make it simple to perform even the most complex stunts, such as a 360 degree flip midair, pirouettes and rolls.  The copters stability is further enhanced by the four propellers. Additional blades add to the balance of the copter, and make it simple for even beginners to fly. Each blade is protected by a safety guard, which will protect the blade from any collisions during flight and landing, as well as shield the user fingers from the fast-spinning propellers.  Controlled by a 4 channel 2.4 GHZ remote, this quadcopter can fly up to heights of 300 feet. LED Lights will help keep track of this drone while in flight, and provide a spectacular visual effect.  A combination of superior features and attention to details make this the ultimate quadcopter for any flight enthusiast.  Requires 4-AAA batteries that are included.  Age - 14 and up."
